welcome-message	**UNIVERSIDAD TÉCNICA FEDERICO SANTA MARÍA**\r\n\r\nLAB. DE COMPUTACIÓN PARA LAS APLICACIONES DE LA MATEMÁTICA EN INGENIERÍA.\r\n\r\n---\r\n\r\nEl Departamento de Matemática de la UTFSM a través de los laboratorios de computación tiene como misión innovar en la formación de pregrado en Matemática para las carreras de Ingeniería, introduciendo herramientas computacionales necesarias para comprender, aplicar y potenciar conocimientos aprendidos en cursos dictados en forma tradicional, esto es, en cátedras de tipo conferencia. De esta manera, cada laboratorio de computación es una actividad complementaria a la clase teórica destinada fundamentalmente a trabajar con computador, y software matemáticos apropiados, algunos conceptos y métodos revisados en teoría, lo que además permite estudiar aplicaciones más avanzadas de la matemática en ingeniería.\r\n\r\n**Responsable Laboratorio:** Dr. Jaime Figueroa Nieto.
